import React from "react";

const Form = () => {
  return (
    <>
      <div className=" d-flex justify-content-center">
        <div>
          <input type="text" className="form-control" />
        </div>
        <div>
          <button
            className="btn btn-primary  "
            style={{ "margin-left": "5px" }}>
            Add new task
          </button>
        </div>
      </div>
    </>
  );
};

export default Form;
